export default function CSSExample() {
  const square = {
    backgroundColor: "green",
    height: "50px",
    width: "50px",
    marginLeft: "1rem",
  };

  return (
    <>
      <h1 className="red">CSS Example</h1>

      <h2 style={{ color: "blue", fontSize: "25px" }}>Subtext</h2>

      <div style={square}></div>
    </>
  );
}
